records.addlTxt:
Defendant Terrence L Martin in court, in custody, with attorney Matt Last.    District Attorney's Office Law Intern appeared for the State of Wisconsin.    Defendant enters a guilty plea to Count 2.  Court finds defendant guilty.  Counts 1 and 3 are dismissed and read in.

The Court Orders the Following:

Imposed Sentence of:

4 Years 6 months Imprisonment (Credit - 5 days )
- 1 Years  6 months of Initial Confinement
- 3 Years of Extended Supervision

Conditions of Extended Supervision:
- AODA Assessment and follow through with any treatment recommended if agent believes necessary;
- Psychological Evaluation and follow through with any treatment recommended;
- Perform 20 hours of community service each year of supervision with it to be completed within 60 days of the end of supervison; 
- Take a Criminal Thinking Course;.
- Take a Victim Impact Course; 
- Complete High School Education within first 12 months;
- Obtain valid driver's license;
- Operate a Motor Vehicle with a Valid Drivers License;
- Maintain/Obtain full time employment;
- Provide DNA sample if not yet provided  and pay surcharge

Restitution: $1664.00  ($745.84 Walmart in Menomonee Falls,  $329.34 Walmart in New Berlin and $588.82 Walmart in Town of Waukesha)   -To be paid during extended supervision at the rate of $75 per month commencing the 60th day of release onto supervision.  BAIL TO APPLY.  Court orders that the statutory surcharges for restitution is waived.  

Costs: $ 268.00
DNA Surcharge:  $250.00
(To to be paid during the first 2 years of supervision.).

Defendant is not eligible for the Challenge Incarceration Program
Defendant is not eligible for the Substance Abuse Program

Felony warnings, immigration warnings,  voting rights and firearms warnings given.
